script: |
  super -f text -I q9633.spq | sort > q9633.out

inputs:
  - name: q9633.spq
    data: |
      SELECT col2 + + 99 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + 74 NOT BETWEEN ( col1 ) AND - col2 + - + ( + + col0 ) * - - col2 * col0 * - 12;
  - name: tab0

outputs:
  - name: q9633.out
    data: |
      109
      198
